Тайваньцев купаются в океане мало из-за:
1) Мутрой воды, от песка которой мыться нужно;
2) Я слышал тайваньцев плохо плавают и боятся воды вообще;
3) У Тихого Океана сильное отмочное течение — опасно;
4) Часто землетрясения и из-за них может отступить вода и утянуть вдаль. https://t.co/2t8RJ8C4j1

Также много кто переехал сюда из-за внутренних благоприятных условий, просто после посещения острова
1) Климат;
2) Вкусная еда;
3) Безопасность от ковида. Таких за последний год тут много стало. И как только у нас начались заражения, такие в большей степени уже свалили.
